# https://leetcode.com/problems/lemonade-change/
# easy

def lemonadeChange(bills) -> bool:
    """
    :type bills: List[int]
    :rtype: bool
    """
    my_bills = {
        5: 0,
        10: 0,
        20: 0,
    }
    i = 0
    for b in bills:
        i += 1
        print(i, b)
        if i == 121:
            print('pause')
        if b == 10:
            if my_bills[5] >= 1:
                my_bills[5] -= 1
            else:
                return False
        if b == 20:
            if my_bills[10] >= 1 and my_bills[5] >= 1:
                my_bills[5] -= 1
                my_bills[10] -= 1
            elif my_bills[5] >= 3:
                my_bills[5] -= 3

            else:
                return False
        my_bills[b] += 1
        print(i, b)
    return True





